import React, { useState, useEffect } from 'react';

function Top() {
  const [data1, setData1] = useState(null);
  const [data2, setData2] = useState(null);

  useEffect(() => {
    navigator.geolocation.getCurrentPosition(
      function(position) {
        setData1(position.coords.latitude);
        setData2(position.coords.longitude);
      },function(){
        setData1(0);
        setData2(0);
      }
    )
  }, []);

  return (
    <form action="http://localhost:8080" method="GET">
      <label for="name">店名</label>
      <input id="name" type="text" name="name"/>
      <label for="range">範囲</label>
      <input id="range" type="text" name="range"/>
      <input class="notDisplay" type="number" name="latitude" value={data1} />
      <input class="notDisplay" type="number" name="longitude" value={data2} />
      <input type="submit" value="Submit" />
    </form>
  );
}
export default Top;
